Mint condition Mossberg 500 Persuader:
Matte black, 18.5 bbl, pistol grip, adjustable stock;
5+1 capacity, shoots both 2 3/4 inch and 3 inch shells;
Includes hard case, wire-brush squeegee, and 20 shells (10 slugs, 10 00-buck).

The gun is nearly brand new; it's had 40 rounds through it, and been cleaned once.  For reference, Mossberg recommends cleaning once every 500 rounds.
